import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import {Jumbotron, Grid, Row, Col, Image, Button } from 'react-bootstrap';
import './Home.css';
import Gage from './gauges/DataGauge';
import Trend from './gauges/LineGraph';
import Rawvals from './gauges/Raw';
import LiquidFillGauge from './gauges/LiquidGauge';


export default class Home extends   Component{

    render(){
        return(

            <Grid>
                {/* 
                <Jumbotron>
                    <h2>Welcome to my page</h2>
                    <p>This is how to build a webiste with react, react router, and react bootsrap</p>
                    <Link to="/about">
                    <Button bsStyle="primary">about</Button>
                    </Link>
                </Jumbotron>
                */}

                <Row className="show-grid text-center">
                    <Col xs={12} sm={4} >
                        <Gage devID={'devID01'} keyVal={'SPEED'} name={'KPH'} minVal={0} maxVal={140} />
                    </Col>
                    <Col xs={12} sm={4} >
                    <   Gage devId={'devID01'} keyVal={'RPM'} name={'RPM'} minVal={0} maxVal={8000} />  
                    </Col>
                    <Col xs={12} sm={4} >
                    <   Gage devId={'devID01'} keyVal={'INTAKE_TEMP'} name={'Throttle %'} minVal={0} maxVal={100} /> 
                    </Col>
                </Row>


                <Row>
                    <Rawvals/>
                </Row>
                <Row>
                    <Col xs = {2} sm ={2} > 
                    <Trend/>
                    </Col>
                </Row> 

                <LiquidFillGauge/>


            </Grid>
        )
    }
}
